import { TestBed } from '@angular/core/testing';
import { MatDialogModule } from '@angular/material/dialog';
import { HttpClientModule } from '@angular/common/http';
import { UserlistComponent } from './userlist.component';
import { UsersService } from '../users.service';
describe('UserlistComponent', () => {
    let component;
    let fixture;
    beforeEach(async () => {
        await TestBed.configureTestingModule({
            declarations: [UserlistComponent],
            imports: [MatDialogModule,
                HttpClientModule]
        })
            .compileComponents();
    });
    beforeEach(() => {
        fixture = TestBed.createComponent(UserlistComponent);
        component = fixture.componentInstance;
        fixture.detectChanges();
    });
    //   it('should create', () => {
    //     expect(component).toBeTruthy();
    //   });
    it('should check getUser() is calling or not', () => {
        const userServices = fixture.debugElement.injector.get(UsersService);
        fixture.detectChanges();
        expect(userServices.getUser()).toBeTruthy();
    });
    it('should check deleteUser() is calling or not', () => {
        const userServices = fixture.debugElement.injector.get(UsersService);
        fixture.detectChanges();
        expect(userServices.deleteUser(1)).toBeTruthy();
    });
    it('should call open Dialog', () => {
        let button = fixture.debugElement.nativeElement.querySelector('button');
        button.click();
        fixture.whenStable().then(() => {
            expect(UserlistComponent);
        });
    });
});
